Ok, it sounds like you grabbed an older version of libandroid_tensorflow_inference_java.jar than the demo code you're compiling against. Where did you find the file?

To use the AAR you can add this to your gradle config:
```
allprojects {
    repositories {
        jcenter()
    }
}

dependencies {
    compile 'org.tensorflow:tensorflow-android:+'
}
```

You can replace the + with a known compatible version number of TensorFlow to prevent future changes from causing issues (though we try to keep the Android releases backwards compatible).
